import { categoryConstants } from "../actions/constants";

const initState = {
    categoryList: [],
    loading: false,
    error: null
}

export default (state = initState, action) => {

    console.log(action);

    switch (action.type) {
        case categoryConstants.GET_ALL_CATEGORIES_SUCCESS:
            state = {
                ...state,
                categoryList: action.payload.categoryList
            }
            break;

    }
    return state;
}
